In all cases, you have:

    case ${CMD}
      SOME_CMD)
        echo "SOME_CMD"
        # handling

Instead, you could do:

    echo ${CMD}
    case ${CMD}
      SOME_CMD)
        # handling

I'm assuming that somewhere in the code, there is something like this:

    char cmd_path[256] = {0};
    snprintf(cmd_path, "%s/pa_wifi.sh", LEGATO_WIFI_PA);
    // now execute command in cmd_path

Why don't we just make LEGATO_WIFI_PA point to the file itself?  This has a few benefits:

 - rather than having to create "some_wifi_implementation/pa_wifi.sh" you can just create "pa_some_wifi_implementation.sh"
 - It doesn't force the user to have their PA file be named with a .sh extension.  Maybe they want to write it in python or perl or C instead
 - Simplifies the code since there's no need to concatenate strings to produce the full path to the command

